    var lobbyMapGrid = [];
    for (var i = 0; i < 32; i++) {
        lobbyMapGrid[i] = []
        for (var j = 0; j < 47; j++) {
            lobbyMapGrid[i][j] = lobbyArray[i * 47 + j];
        }
    }

    var gameMapGrid = [];
    for (var i = 0; i < 81; i++) {
        gameMapGrid[i] = []
        for (var j = 0; j < 86; j++) {
            gameMapGrid[i][j] = mapArray[i * 86 + j];
        }
    }

    var lynchPositions = function(xCor, yCor, position) {
        var self = {
            x: xCor,
            y: yCor,
            pos: position
        }
        return self;
    }
    var lynchCoordinates = [lynchPositions(97, 116, 1), lynchPositions(352, 116, 2), lynchPositions(605, 116, 3), lynchPositions(223, 272, 4), lynchPositions(478, 272, 5)];

    var getLynchCoordinate = function() {
        if (lynchCoordinates.length == 0) {
            lynchCoordinates = [lynchPositions(97, 116, 1), lynchPositions(352, 116, 2), lynchPositions(605, 116, 3), lynchPositions(223, 272, 4), lynchPositions(478, 272, 5)];
        }
        return lynchCoordinates.shift();
    }

    var Entity = function(param) {
        var self = {
            x: 250,
            y: 250,
            spdX: 0,
            spdY: 0,
            name: "",
            gameGrid: gameMapGrid,
            lobbyGrid: lobbyMapGrid
        }
        self.currentGrid = self.lobbyGrid;
        self.gameStart = false;
        self.updateGrid = function() {
            if (self.gameStart) {
                self.currentGrid = self.gameGrid;
            } else {
                self.currentGrid = self.lobbyGrid;
            }
        }

        if (param) {
            if (param.x) {
                self.x = param.x;
            }
            if (param.y) {
                self.y = param.y;
            }
            if (param.map) {
                self.map = param.map;
            }
            if (param.id) {
                self.id = param.id;
            }
        }
        
        self.isPositionWall = function(pt) {
            var gridX = Math.floor(pt.x / tileSize);
            var gridY = Math.floor(pt.y / tileSize);
            if(gridX < 0 || gridX >= self.currentGrid[0].length) {
                return true;
            }
            if(gridY < 0 || gridY >= self.currentGrid.length) {
                return true;
            }
            return self.currentGrid[gridY][gridX]
        }
        self.updatePosition = function () {
            const oldX = self.x;
            const oldY = self.y;
            self.x += self.spdX;
            self.y += self.spdY;
            if (self.isPositionWall(self
                )) {
                self.x = oldX;
                self.y = oldY;
            }
        }
        return self;
    }

    var Player = function(name, id) {
        var self = Entity();
        self.name = name;
        self.pressingRight = false;
        self.pressingLeft = false;
        self.pressingUp = false;
        self.pressingDown = false;
        self.maxSpeed = 3;
        self.id = id;
        self.voteCount = 0;
        self.groupId = null;
        self.lynchCoordinate = getLynchCoordinate();
        self.updateSpd = function() {
            if (self.pressingRight) {
                self.spdX = self.maxSpeed;
            } else if (self.pressingLeft) {
                self.spdX = -self.maxSpeed;
            } else {
                self.spdX = 0;
            }
            if (self.pressingUp) {
                self.spdY = -self.maxSpeed;
            } else if (self.pressingDown) {
                self.spdY = self.maxSpeed;
            } else {
                self.spdY = 0;
            }
        }
        self.update = function() {
            self.updateSpd();
            self.updatePosition();
        }
        Player.list[id] = self;
        Player.tempList[id] = self;
        return self;
    }

    Player.list = {};
    Player.tempList = {};
    Player.numberOfPlayers = 0;

    Player.onConnect = function(socket) {
        var player = Player(socket.name, socket.id);
        for (var i in Player.tempList) {
            initPack.player.push(Player.tempList[i]);
        }
        initPack.selfId = socket.id;
        var socketGroupId = null;
        if (Player.numberOfPlayers === 0) {
            socketGroupId = MAIN_SOCKET_LIST.length;
            MAIN_SOCKET_LIST[socketGroupId] = [];
        } else if (Player.numberOfPlayers < 5) {
            socketGroupId = MAIN_SOCKET_LIST.length - 1;
        }
        socket.groupId = socketGroupId;
        MAIN_SOCKET_LIST[socketGroupId].push(socket);
        player.groupId = socketGroupId;
        Player.numberOfPlayers = Player.numberOfPlayers + 1;
        for(var i in MAIN_SOCKET_LIST[socket.groupId]) {
        var SOCKET = MAIN_SOCKET_LIST[socket.groupId][i];
        SOCKET.emit('init', initPack);
        }
        initPack.player = [];
        if (Player.numberOfPlayers === 5) {
            for(var i in MAIN_SOCKET_LIST[socket.groupId]) {
                var SOCKET = MAIN_SOCKET_LIST[socket.groupId][i];
                SOCKET.emit('gameStart');
                SOCKET.inGame = true;
            }
            Player.numberOfPlayers = 0;
            Player.tempList = {}
        }

        socket.on('gameStarted', function(data) {
            var grpID = data.groupID;
            for (var i in Player.list) {
                var player = Player.list[i]
                if (player.groupId == grpID) {
                    player.gameStart = true;
                    player.updateGrid();
                    player.x = 250;
                    player.y = 250;   
                }
            }
            setTimeout(() => {
                socket.emit('gameLoaded');
            }, 3000)
            setTimeout(() => {
                socket.emit('lynchTime'); 
            }, 16000)
        })


        socket.on('keyPress', function(data) {
            if (data.input === 'left') {
                player.pressingLeft = data.state;
            } else if (data.input === 'right') {
                player.pressingRight = data.state;
            } else if (data.input === 'up') {
                player.pressingUp = data.state;
            } else if (data.input === 'down') {
                player.pressingDown = data.state;
            }
        });
        socket.on('sendMsgToServer', function(data) {
            var name = data.name;
            var message = data.msg;
            var finalMessage = name + ": " + message;
            for(var i in SOCKET_LIST) {
                SOCKET_LIST[i].emit('addToChat', finalMessage);
            }
        })
    }
    Player.onDisconnect = function(socket) {
        removePack.player.push(Player.list[socket.id]);
        var sockets = MAIN_SOCKET_LIST[socket.groupId];
        for (var i in sockets) {
            var socketed = sockets[i]
            socketed.emit('remove', removePack);
        }
        removePack.player = [];
        delete Player.list[socket.id];
        delete Player.tempList[socket.id];
    }
    Player.update = function() {
        var pack = {};
        var packs = [];
            for(var i in Player.list) {
                var player = Player.list[i];
                var playerGroupId = Player.list[i].groupId;
                player.update();
                pack.x = player.x;
                pack.y = player.y;
                pack.name = player.name;
                pack.id = player.id;
                if (packs[playerGroupId] == null) {
                    packs[playerGroupId] = []
                }
                packs[playerGroupId].push(pack);
                pack = {};
            } 
        return packs;
    }
